s decet combibo audacia. Dolor arma currus cum. Vesco cuppedia coma temptatio ultra.',2,'2025-02-26','2025-03-07',6,5,10000,2,'finished','2025-12-15 17:54:36','2025-12-15 17:54:36'),(102,'Viaje a Tikal en Guatemala','Cornu curriculum demo caritas. Desidero nobis pariatur acies solvo pariatur. Praesentium adduco arceo denuncio vindico.\nCatena contigo studio deduco curvo angelus quam nam. Recusandae coma accommodo ait cauda vesco sui. Caute adsidue aeneus arto tergum voveo virtus appositus.',72,'Tikal','https://picsum.photos/seed/guatemala/800/600','Deripio verecundia vulticulus pax conduco. Admoneo adsuesco tamquam coma charisma atque amiculum aliquam canto vomica. Sto non cruciamentum.',6,'2025-06-14','2025-07-31',6,3,5500,3,'finished','2025-12-15 17:54:36','2025-12-15 17:54:36'),(103,'Aventura en Petra en Jordania','Vesco angulus veniam aegrotatio cinis ascisco vicinus corona peior. Odio labore derideo aiunt succurro victoria adamo a. Curiositas theca velit tum sub vacuus nisi.\nArcus velociter quos verecundia cilicium. Vivo damnatio tollo desipio sursum. Apud modi auctor animus inventore deinde tredecim.',90,'Petra','https://picsum.photos/seed/jordania/800/600','Laboriosam complectus solvo quod. Confido tabgo attonbitus. Supellex tamquam vicinus chirographum.',1,'2024-02-27','2024-04-03',7,1,4500,5,'finished','2025-12-15 17:54:36','2025-12-15 17:54:36'),(104,'Excursión a Fortaleza de Roca Sigiriya en Sri Lanka','Vulticulus exercitationem cito beatus temptatio. Tardus voluptatum caelum saepe eos solus. Usus speculum solum cultura infit illum aro vobis.\nArbustum adfectus clementia clarus earum adnuo ait. Bardus valens altus animus tendo solutio. Cohaero nesciunt capillus cur calamitas valde.',159,'Fortaleza de Roca Sigiriya','https://picsum.photos/seed/srilanka/800/600','Eum soleo cilicium perspiciatis vicinus canto creta ambitus labore carbo. Desolo tenax ver. Conatus adeo tenetur cado deleo vigilo cenaculum.',3,'2025-04-10','2025-04-19',7,5,4000,7,'finished','2025-12-15 17:54:36','2025-12-15 17:54:36'),(105,'Escapada por Isla Ometepe en Nicaragua','Perferendis cum speciosus maiores. Atqui optio cenaculum creber crepusculum alo agnitio aeternus delinquo neque. Nam tubineus cruciamentum arceo tantillus sollers.\nCaecus acervus accusator explicabo. Corporis canis claro assentator calco ara at. Amicitia animadverto nihil tempus advoco defaeco somniculosus.',124,'Isla Ometepe','https://picsum.photos/seed/nicaragua/800/600','Itaque adfectus aestus cometes conturbo nobis. Aggero tripudio comes solium timor vito coniecto aequus tergiversatio. Libero quia succedo sit adnuo cresco adopto.',3,'2027-06-24','2027-08-15',8,8,3800,10,'cancelled','2025-12-15 17:54:36','2025-12-15 17:54:36'),(106,'Escapada por Reserva Maasai Mara en Kenia','Solium adulatio virga sto thesis verto eius beatae adulescens tunc. Coruscus aggredior demulceo tristis timor. Adaugeo deripio culpa utique certus vester.\nStrenuus alienus demo aureus cogo tracto confido arguo stella amplus. Virgo cicuta auctus arto fugit reiciendis caste. Comburo quaerat reiciendis adimpleo vero quo alii.',92,'Reserva Maasai Mara','https://picsum.photos/seed/kenia/800/600','Fugiat substantia totus demulceo vulnus turba maxime candidus. Aggero bestia cum. Teres decens omnis porro coniecto iusto defetiscor umbra altus.',5,'2024-03-30','2024-04-26',8,2,5800,10,'finished','2025-12-15 17:54:36','2025-12-15 17:54:36');
